import "./conversationScreen.css";
import "./usersList.css";
import "./messages.css";
function ContMess(props) {
  return (
    <div className="">
      <div className="messageWrapper"><img className="connectedUsersImage" src="images/miki.png" alt="" />
      <div className= {props.mine ? "myMessage" : "friendMessage"}>
        the sub-components included in a responsive light-themed navbar that
        automatically collapses at the lg (large) breakpoint.
      </div></div>
    </div>
  );
}
export default ContMess;
